```cpp
#include <iostream>
#include <fstream>
#include <string>
#include <algorithm>

// Function to count occurrences of a word in a line
int countOccurrences(const std::string &line, const std::string &word) {
    int count = 0;
    std::string::size_type pos = 0;

    while ((pos = line.find(word, pos))!= std::string::npos) {
        count++;
        pos += word.length();
    }

    return count;
}

int main() {
    std::string filename;
    std::string word;

    std::cout << "Enter the filename: ";
    std::cin >> filename;
    std::cout << "Enter the word to count: ";
    std::cin >> word;

    std::ifstream file(filename);
    if (!file.is_open()) {
        std::cerr << "Unable to open file " << filename << std::endl;
        return 1;
    }

    std::string line;
    int totalCount = 0;

    while (std::getline(file, line)) {
        totalCount += countOccurrences(line, word);
    }

    file.close();

    std::cout << "The word \"" << word << "\" occurs " << totalCount << " times in the file." << std::endl;

    return 0;
}
```

### Explanation:
1. **countOccurrences Function**: This function takes a line of text and a word, and counts how many times the word appears in the line.
2. **Main Function**:
   - Prompts the user to enter the filename and the word to count.
   - Opens the file and checks if it is successfully opened.
   - Reads the file line by line using `std::getline`.
   - For each line, it calls `countOccurrences` to count the occurrences of the word and adds the count to `totalCount`.
   - Closes the file and prints the total count of the word in the file.

### Usage:
1. Save the code to a file, for example, `word_count.cpp`.
2. Compile the code using a C++ compiler, for example:
   ```sh
   g++ -o word_count word_count.cpp
   ```
3. Run the executable:
   ```sh
  ./word_count
   ```
4. Enter the filename and the word to count when prompted. The program will display the number of occurrences of the word in the file.
